gUC(){return"Busco uma posi\xe7\xe3o como Flutter Developer Full-Stack/Front-end, onde eu possa aplicar minhas habilidades em desenvolvimento front-end, utilizando a tecnologia Flutter para criar experi\xeancias excepcionais para os usu\xe1rios. Meu objetivo \xe9 contribuir para projetos inovadores, colaborando com equipes multidisciplinares e aplicando meu conhecimento em clean code, arquitetura MVC/MVVM e metodologias \xe1geis para fornecer solu\xe7\xf5es de alta qualidade.\nAl\xe9m disso, busco oportunidades para aprimorar meu conhecimento em desenvolvimento back-end, buscando sempre propor evolu\xe7\xf5es tecnol\xf3gicas nos sistemas. Estou entusiasmado em fazer parte de um ambiente colaborativo, onde possa desenvolver aplicativos eficientes e impactantes para atender \xe0s necessidades dos usu\xe1rios e contribuir para o crescimento da empresa."},
